// ==UserScript==
// @author         Jonas Thelemann
// @description    Adds a trollface or trolltext to some (more or less) large websites.
// @description:de Fügt ein Trollface oder einen Trolltext auf einigen (mehr oder weniger) großen Websites ein.
// @grant          none
// @icon           data:image/png;base64,
// @include        *apple.com*
// @include        *bing.com*
// @include        *dropbox.com*
// @include        *duckduckgo.com*
// @include        *ecosia.org*
// @include        *google.de*
// @include        *microsoft.com*
// @include        *netflix.com*
// @include        *spiegel.de*
// @include        *wikipedia.org*
// @include        *youtube.com*
// @license        GPL version 3 or any later version; http://www.gnu.org/licenses/gpl.txt
// @name           Troll'em
// @name:de        Troll'em
// @namespace      https://greasyfork.org/users/4685
// @version        1.3
// ==/UserScript==
//Einfügen erlauben
if (window.location.href.indexOf('apple') > - 1) {
  // Replace the apple logo with a trollface
  document.getElementById('ac-gn-firstfocus').parentNode.innerHTML = '<img src="data:image/png;base64," alt="ABISTREICH"></img>';
} else if (window.location.href.indexOf('bing') > - 1) {
  // Replace "Bing" with "Troll" next to search bar
  document.getElementById('sbox').firstChild.style.background = 'url(\'data:image/png;base64,\')';
} else if (window.location.href.indexOf('dropbox') > - 1) {
  // Replace upper headline "Dropbox" with "Trollbox"
  document.getElementById('dropbox-logo').getElementsByTagName('img')[1].src = 'data:image/png;base64,';
} else if (window.location.href.indexOf('duckduckgo') > - 1) {
  // Replace logo's duck with a trollface
  document.getElementById('logo_homepage_link').style.backgroundImage = 'url(\'data:image/png;base64,\')'
} else if (window.location.href.indexOf('ecosia') > - 1) {
  // Replace logo's world with a trollface
  document.getElementById('logo').parentNode.innerHTML = '<img src="data:image/png;base64," alt="ABISTREICH"></img>';
} else if (window.location.href.indexOf('google') > - 1) {
  // Replace the "O"s of google's main logo with trollfaces and write "Trollland" under it
  document.getElementById('lga').innerHTML = '<div style="padding-top:109px"><style>@media (-moz-max-device-pixel-ratio:1),(max-resolution:96dpi){#hplogo{background: transparent url("data:image/png;base64,") no-repeat scroll 0% 0%; width: 272px; height: 92px;}}</style><div title="Google" id="hplogo" onload="window.lol&amp;&amp;lol()" align="left"><div class="logo-subtext">Trollland</div></div></div>';
  // Replace the "O"s of google's search logo with trollfaces
  document.querySelector('#logo > img:nth-child(1)').src = 'data:image/png;base64,';
} else if (window.location.href.indexOf('microsoft') > - 1) {
  // Replaces top left small icon's text "Microsoft" with "Trollsoft"
  document.getElementById('srv_shellHeaderMicrosoftLogo').innerHTML = '<img src="data:image/png;base64," alt="ABISTREICH"></img>';
} else if (window.location.href.indexOf('netflix') > - 1) {
  // Replaces top left small icon's text "Netflix" with "Nettroll"
  document.getElementsByClassName('icon-logoUpdate')[0].parentNode.innerHTML = '<a href="/de/" class="nfLogo signupBasicHeader" data-reactid=".mtwuzh9ukg.1.1"><img src="data:image/png;base64,"></img></a>'
} else if (window.location.href.indexOf('spiegel') > - 1) {
  // Replaces top left small icon's text "Spiegel Online" with "Trollgel Online"
  document.getElementsByClassName('header-logo')[0].innerHTML = '<img src="data:image/png;base64," alt="ABISTREICH" title="Trollgel Online" height="32" width="230">';
} else if (window.location.href.indexOf('wikipedia') > - 1) {
  // Replace the top left icon with a trollface and the text "Wikipedia" below it with "Trollipedia"
  document.getElementsByClassName('mw-wiki-logo')[0].style.backgroundImage = 'url(\'data:image/png;base64,\')';
} else if (window.location.href.indexOf('youtube') > - 1) {
  // Replace the top left "YouTube" icon with "YouTroll"
  document.getElementsByClassName('masthead-logo-renderer-logo')[0].style.background = 'no-repeat url(\'data:image/png;base64,\')';
}